import React from 'react'

class Layout extends React.Component {

    constructor(props) {
        console.log(props)

        super(props)


    }
    render() {
        return (
            <div>
                <h2>Form submit successfully </h2>
                <h2>First Name  : {this.props.children}</h2>
            </div>
        )
    }
}


export default Layout;
